function data_split(data){
    var row_data=[];
    var dataset=[];
    row_data=data.split('/n');
    
    row_data.forEach(function(element, lineNo) {
        if(lineNo==0){
            return;
        }
        dataset.push(element.split(","));
    });
    return dataset;
    
}

function array_split(data){
    var dataset=[];
    var string_data=[];
    string_data=data.split(',');

    string_data.forEach(function(element , index){
        dataset.push(parseInt(element));
    });

    return dataset;
}